import React, { Component } from 'react';

class Home extends Component {

    getData=(images)=>{
       const img= images.map(image =>{
            return image
        });
    }



    render() {
        return (
            <React.Fragment>
                <div className="row">
                    <div className="col-lg-3">
                        <div className="single-photo-item">
                            <div className="d-block">
                                <div className="photo-wrapper">
                                    <img src='' alt={img.alt_description} />
                                </div>
                                <h5>''</h5>
                                <p className="cat-name">by - '' ''</p>
                            </div>


                        </div>
                    </div>
                </div>


                <div className="row">
                    <div className="col-lg-12 text-center">
                        <div className="load-more-btn">''</div>
                    </div>
                </div>
            </React.Fragment>
        );
    }
}

export default Home;
